        /// <summary>
        /// 導預覽畫面
        /// </summary>
        /// <param name="model"></param>
        /// <returns></returns>
        [HttpPost]
        public ActionResult Apply(Apply_010002FormModel model)
        {
            SessionModel sm = SessionModel.Get();
            if (sm == null || sm.UserInfo == null) { return RedirectToAction("Index", "History"); }
            ClamMember mem = sm.UserInfo.Member;
            if (mem == null) { return RedirectToAction("Index", "History"); }

            AjaxResultStruct result = new AjaxResultStruct();
            ApplyDAO dao = new ApplyDAO();

            string ErrorMsg = "";
            if (!string.IsNullOrEmpty(model.FILE_DISEASE_TEXT))
            {
                logger.Debug("Apply_010002.FileName:" + model.FILE_DISEASE_TEXT);
                // 允許的附檔名（全小寫）
                var validExts = new[] { "pdf", "jpg", "jpeg", "bmp", "png", "gif", "tif", "zip", "doc", "docx", "odt", "odf", "ods", "xls", "xlsx", "ppt", "pptx" };
                // 取得副檔名並轉小寫
                var ext = model.FILE_DISEASE_TEXT.ToSplit(".").LastOrDefault().ToLower();
                if (!validExts.Contains(ext))
                {
                    ErrorMsg += "不支援的檔案格式";
                }
            }
            if (!string.IsNullOrEmpty(model.FILE_IDCNB_TEXT))
            {
                logger.Debug("Apply_010002.FileName:" + model.FILE_IDCNB_TEXT);
                // 允許的附檔名（全小寫）
                var validExts = new[] { "pdf", "jpg", "jpeg", "bmp", "png", "gif", "tif", "zip", "doc", "docx", "odt", "odf", "ods", "xls", "xlsx", "ppt", "pptx" };
                // 取得副檔名並轉小寫
                var ext = model.FILE_IDCNB_TEXT.ToSplit(".").LastOrDefault().ToLower();
                if (!validExts.Contains(ext))
                {
                    ErrorMsg += "不支援的檔案格式";
                }
            }
            if (!string.IsNullOrEmpty(model.FILE_IDCNF_TEXT))
            {
                logger.Debug("Apply_010002.FileName:" + model.FILE_IDCNF_TEXT);
                // 允許的附檔名（全小寫）
                var validExts = new[] { "pdf", "jpg", "jpeg", "bmp", "png", "gif", "tif", "zip", "doc", "docx", "odt", "odf", "ods", "xls", "xlsx", "ppt", "pptx" };
                // 取得副檔名並轉小寫
                var ext = model.FILE_IDCNF_TEXT.ToSplit(".").LastOrDefault().ToLower();
                if (!validExts.Contains(ext))
                {
                    ErrorMsg += "不支援的檔案格式";
                }
            }
            if (!string.IsNullOrEmpty(model.FILE_LOWREC_TEXT))
            {
                logger.Debug("Apply_010002.FileName:" + model.FILE_LOWREC_TEXT);
                // 允許的附檔名（全小寫）
                var validExts = new[] { "pdf", "jpg", "jpeg", "bmp", "png", "gif", "tif", "zip", "doc", "docx", "odt", "odf", "ods", "xls", "xlsx", "ppt", "pptx" };
                // 取得副檔名並轉小寫
                var ext = model.FILE_LOWREC_TEXT.ToSplit(".").LastOrDefault().ToLower();
                if (!validExts.Contains(ext))
                {
                    ErrorMsg += "不支援的檔案格式";
                }
            }

            if (ModelState.IsValid)
            {
                ModelState.Clear();

                if (ErrorMsg == "")
                {
                    result.status = true;
                    result.message = "";
                }
                else
                {
                    result.status = false;
                    result.message = ErrorMsg;
                }
            }
            else
            {
                result.status = false;
                foreach (ModelState item in ModelState.Values)
                {
                    if (item.Errors.ToCount() > 0)
                    {
                        ErrorMsg = ErrorMsg + item.Errors[0].ErrorMessage + "\r\n";
                    }
                }

                result.message = ErrorMsg;
            }

            return Content(result.Serialize(), "application/json");
        }

