        /// <summary>
        /// 取得與整理，使用者端的資料
        /// </summary>
        /// <param name="form"></param>
        public void zAdjform(Apply_010002FormModel form)
        {
            //form.APPLY_DATE = HelperUtil.TransTwToDateTime(form.APPLY_DATE_TW);

            form.BIRTHDAY = HelperUtil.TransToDateTime(form.BIRTHDAY_AD);
            form.BIRTHDAY_TW = HelperUtil.DateTimeToTwString(form.BIRTHDAY);

            //form.TEL = $"{form.TEL_0.TONotNullString()}-{form.TEL_1.TONotNullString()}#{form.TEL_2.TONotNullString()}";
            if (form.TEL_0.TONotNullString() != "" && form.TEL_1.TONotNullString() != "")
            {
                form.TEL = form.TEL_2.TONotNullString() != "" ? form.TEL_0 + "-" + form.TEL_1 + "#" + form.TEL_2 : form.TEL_0 + "-" + form.TEL_1;
            }

            if (form.TEL.Length > 40) { form.TEL = form.TEL.Substring(0, 40); }
            form.MOBILE = form.MOBILE.TONotNullString();
            switch (form.EMAIL_1.TONotNullString())
            {
                case "0":
                    form.EMAIL = form.EMAIL_0.TONotNullString() + "@" + form.EMAIL_2.TONotNullString();
                    break;
                case "1":
                    form.EMAIL = form.EMAIL_0.TONotNullString() + "@gmail.com";
                    break;
                case "2":
                    form.EMAIL = form.EMAIL_0.TONotNullString() + "@yahoo.com.tw";
                    break;
                case "3":
                    form.EMAIL = form.EMAIL_0.TONotNullString() + "@outlook.com";
                    break;
            }
            // form.EMAIL = $"{form.EMAIL_0.TONotNullString()}@{form.EMAIL_2.TONotNullString()}";

            form.SPBIRTHDAY = HelperUtil.TransToDateTime(form.SPBIRTHDAY_AD);
            form.SPBIRTHDAY_TW = HelperUtil.DateTimeToTwString(form.SPBIRTHDAY);

            //form.SPTEL = $"{form.SPTEL_0.TONotNullString()}-{form.SPTEL_1.TONotNullString()}#{form.SPTEL_2.TONotNullString()}";
            if (form.SPTEL_0.TONotNullString() != "" && form.SPTEL_1.TONotNullString() != "")
            {
                form.SPTEL = form.SPTEL_2.TONotNullString() != "" ? form.SPTEL_0 + "-" + form.SPTEL_1 + "#" + form.SPTEL_2 : form.SPTEL_0 + "-" + form.SPTEL_1;
            }
            if (form.SPTEL.Length > 40) { form.SPTEL = form.SPTEL.Substring(0, 40); }
            form.SPMOBILE = form.SPMOBILE.TONotNullString();
            switch (form.SPEMAIL_1.TONotNullString())
            {
                case "0":
                    form.SPEMAIL = form.SPEMAIL_0.TONotNullString() + "@" + form.SPEMAIL_2.TONotNullString();
                    break;
                case "1":
                    form.SPEMAIL = form.SPEMAIL_0.TONotNullString() + "@gmail.com";
                    break;
                case "2":
                    form.SPEMAIL = form.SPEMAIL_0.TONotNullString() + "@yahoo.com.tw";
                    break;
                case "3":
                    form.SPEMAIL = form.SPEMAIL_0.TONotNullString() + "@outlook.com";
                    break;
            }
            // form.SPEMAIL = $"{form.SPEMAIL_0.TONotNullString()}@{form.SPEMAIL_2.TONotNullString()}";

            if (form.MYDATA_GET1 != null && form.MYDATA_GET1.Equals("Y")) { form.MYDATA_GET_FG1 = true; }
            if (form.MYDATA_GET_FG1)
            {
                form.FILE_IDCNF = null;
                form.FILE_IDCNF_TEXT = null;
                form.FILE_IDCNB = null;
                form.FILE_IDCNB_TEXT = null;
            }
            if (form.MYDATA_GET2 != null && form.MYDATA_GET2.Equals("Y")) { form.MYDATA_GET_FG2 = true; }
            if (form.MYDATA_GET_FG2)
            {
                form.FILE_LOWREC = null;
                form.FILE_LOWREC_TEXT = null;
            }
            if (form.EMAIL_0.TONotNullString() == "")
            {
                form.EMAIL = "";
            }
            if (form.SPEMAIL_0.TONotNullString() == "")
            {
                form.SPEMAIL = "";
            }
        }

