        /// <summary>
        /// 導向「MyData 數位服務個人化網站」進行身分認證及資料同意確認
        /// </summary>
        /// <returns></returns>
        public ActionResult AllowMydata(ClamMember mem)
        {
            string myDataSite = DataUtils.GetConfig("MYDATA_SITE_URL");  // 「MyData 數位服務個人化網站」
            string clientId = DataUtils.GetConfig("MYDATA_CLIENT_ID_010002");  // client_id
            string resourceIdIDCN = DataUtils.GetConfig("MYDATA_RESOURCE_ID_IDCN_010002");  // 取用資料集-個人戶籍資料(resource_id)
            string resourceIdLOWREC = DataUtils.GetConfig("MYDATA_RESOURCE_ID_LOWREC_010002");  // 取用資料集-低收入戶證明(resource_id)
            string clientSecret = DataUtils.GetConfig("MYDATA_CLIENT_SECRET_010002");  // AES-256加密金鑰
            string cbcIv = DataUtils.GetConfig("MYDATA_CBC_IV_010002");  // AES加密向量
            string returnUrl = DataUtils.GetConfig("MYDATA_RETURN_URL_010002");

            List<string> resourceIds = new List<string>();
            resourceIds.Add(resourceIdIDCN);
            resourceIds.Add(resourceIdLOWREC);

            logger.Debug("AllowMydata(): resourceId=" + string.Join(":", resourceIds));
            logger.Debug("AllowMydata(): clientSecret=" + clientSecret);
            logger.Debug("AllowMydata(): cbcIv=" + cbcIv);
            logger.Debug("AllowMydata(): returnUrl=" + returnUrl);
            logger.Debug("AllowMydata(): IDN=" + mem.IDN);

            // 組重導至 MyData 的網址參數
            /* /service/{client_id}/{resource_id_base64encoded_string}/{tx_id}
             *      ?returnUrl ={ sp_return_url}
             *       &pid ={ personalId}
             */

            // 1. 產生 tx_id (version 4 UUID)
            string txId = Guid.NewGuid().ToString("D");
            Session["APPLY_010002_TX_ID"] = txId;

            // 2. 將 TX_ID 更新回案件資料
            string APP_ID = (string)Session["APPLY_010002_APP_ID"];
            ApplyDAO dao = new ApplyDAO();

            Apply_010002Model model = new Apply_010002Model();
            model.APP_ID = APP_ID;
            model.MYDATA_TX_ID = txId;
            dao.UpdateApply010002MyData(model);

            // 3. 以申請人身分證, AES 加密取得 personalId
            string personalId = (new MyData()).AESEncrypt(clientSecret, cbcIv, mem.IDN);

            // 4. 產生完整 MyData Request Url
            string url = myDataSite + "/service/"
                            + clientId + "/"
                            + Convert.ToBase64String(Encoding.UTF8.GetBytes(string.Join(":", resourceIds))) + "/"
                            + txId + "?"
                            + "returnUrl=" + HttpUtility.UrlEncode(returnUrl) + "&"
                            + "pid=" + personalId;

            logger.Info("AllowMydata(): MyData service url: \n" + url);

            // 4.重導
            return new RedirectResult(url);
        }

        /// <summary>
        /// 這個 Action 在使用者於 MyData 網站完成認證授權後，重導返回時被 Invoke
        /// <para>此時使用者應仍在相同的登入Session中</para>
        /// </summary>
        /// <param name="code"></param>
        /// <param name="tx_id"></param>
        /// <returns></returns>
        public ActionResult GetMydata(string code, string tx_id)
        {
            /* 
            string clientSecret = DataUtils.GetConfig("MYDATA_CLIENT_SECRET_010002");  // AES-256加密金鑰
            string cbcIv = DataUtils.GetConfig("MYDATA_CBC_IV_010002");  // AES加密向量
            string tx_id_plain = (new MyData()).AESDecrypt(clientSecret, cbcIv, tx_id);
            */
            SessionModel sm = SessionModel.Get();
            string accNo = "SYSTEM";
            if (sm != null && sm.UserInfo != null && sm.UserInfo.Member != null)
            {
                ClamMember UserInfo = sm.UserInfo.Member;
                accNo = UserInfo.ACC_NO.TONotNullString();
            }
            if (accNo.Equals("SYSTEM"))
            {
                throw new Exception("Session is empty");
            }

            /* 這裡的 tx_id 解密時會有錯誤, 忽略回傳的 tx_id 值 */
            tx_id = (string)Session["APPLY_010002_TX_ID"];
            string APP_ID = (string)Session["APPLY_010002_APP_ID"];

            string content = "APP_ID=" + APP_ID + ", code=" + code + ", " + "tx_id=" + tx_id + "";
            logger.Info("GetMydata: " + content);

            if (string.IsNullOrEmpty(tx_id))
            {
                throw new Exception("Session APPLY_010002_TX_ID is empty");
            }
            if (string.IsNullOrEmpty(APP_ID))
            {
                throw new Exception("Session APPLY_010002_APP_ID is empty");
            }

            string codeDesc = (new MyData()).GetReturnCodeDesc(code);

            // 將 MyData 回應結果記錄到資料庫
            ApplyDAO dao = new ApplyDAO();
            Apply_010002Model model = new Apply_010002Model();
            model.APP_ID = APP_ID;
            model.MYDATA_RTN_CODE = code;
            model.MYDATA_RTN_CODE_DESC = codeDesc;

            dao.UpdateApply010002MyData(model);

            string myDataMsg = "";

            if (!"200".Equals(code))
            {
                myDataMsg = "請留意：<br/>MyData 資料取得失敗：";
                myDataMsg += codeDesc;
            }

            return Done("1", "", myDataMsg);
        }

        /// <summary>
        /// MyData SP-API Endpoint 介面
        /// <para>
        /// MyData 在使用者同意傳送後, 會呼叫這個介面, 並 POST Json 格式的相關資訊進來,
        /// 通知可以去 MyData 抓取使用者的的資料
        /// </para>
        /// <para>這不是給使用者操作的介面，要略過登入狀態檢查</para>
        /// </summary>
        /// <param name="notification"></param>
        /// <returns></returns>
        [Commons.AllowAnonymousAttribute]
        [HttpPost]
        public ActionResult ApiSP()
        {
            /*
             POST 進來的資料(無加密) Content-Type: application/json
             {
                tx_id: {uuid_v4_string},
                permission_ticket: {uuid_v4_string},
                secret_key: {aes-cbc_encrypted_secret_key}
             }
             */

            Request.InputStream.Seek(0, SeekOrigin.Begin);
            string notiJson = new StreamReader(Request.InputStream).ReadToEnd();

            logger.Info("ApiSP: " + notiJson);
            ApplyDAO dao = new ApplyDAO();
            Apply_010002Model model = new Apply_010002Model();

            try
            {
                if (string.IsNullOrEmpty(notiJson))
                {
                    throw new ArgumentException("POST content 為空白");
                }

                // JSON Deserialize/Parse
                MyDataApiSPNotification noti = new MyDataApiSPNotification();
                try
                {
                    noti = (MyDataApiSPNotification)Newtonsoft.Json.JsonConvert.DeserializeObject(notiJson, typeof(MyDataApiSPNotification));
                }
                catch (Exception ex)
                {
                    throw new Exception("JSON Deserialize failed: " + ex.Message, ex);
                }

                if (string.IsNullOrEmpty(noti.tx_id))
                {
                    throw new Exception("tx_id is empty");
                }


                // 以 MyData 的 TX_ID 取得 APPLY_01002 案件資料
                Apply_010002Model app_SN_Where = new Apply_010002Model();
                app_SN_Where.MYDATA_TX_ID = noti.tx_id;
                Apply_010002Model app_SN_data = dao.GetRow(app_SN_Where);
                if (app_SN_data == null)
                {
                    throw new Exception("找不到指定 TX_ID 的 Apply_010002 資料, tx_id=" + noti.tx_id);
                }

                model.APP_ID = app_SN_data.APP_ID;

                if (noti.unable_to_deliver != null && noti.unable_to_deliver.Length > 0)
                {
                    // MyData 告知無法提供資料
                    model.MYDATA_TX_RESULT_MSG = "MyData 無法提供資料: " + string.Join(", ", noti.unable_to_deliver);
                }
                else
                {
                    // 準備去 MyData 抓取資料

                    // 對 secret_key 進行解密 
                    //   ==> 取得明碼 secret_key
                    //   ==> 作為 MyData 取回資料(JWE格式) 解密之用 
                    string clientSecret = DataUtils.GetConfig("MYDATA_CLIENT_SECRET_010002");  // AES-256加密金鑰
                    string cbcIv = DataUtils.GetConfig("MYDATA_CBC_IV_010002");  // AES加密向量

                    string secret_key_plain = "";
                    try
                    {
                        secret_key_plain = (new MyData()).AESDecrypt(clientSecret, cbcIv, Convert.FromBase64String(noti.secret_key));
                    }
                    catch (Exception ex)
                    {
                        throw new Exception("secret_key 解密失敗: " + ex.Message, ex);
                    }

                    /* 
                     * TODO: 以 permission_ticket 取回資料
                     * 因為可能無法立即成功取得, 可能要等待及多次抓取
                     * 所以要以另一個 thread worker 去執行
                     */
                    string myDataSite = DataUtils.GetConfig("MYDATA_SITE_URL");  // 「MyData 數位服務個人化網站」

                    MyData myData = new MyData();
                    string savePath = GetMyDataSavePath(model.APP_ID);
                    myData.GetServiceData(myDataSite, noti.tx_id, noti.permission_ticket, secret_key_plain, savePath, this);

                }

                return Content("OK");
            }
            catch (Exception ex)
            {
                logger.Error("ApiSP Endpoint: " + ex.Message, ex);
                model.MYDATA_TX_RESULT_MSG = "系統異常: " + ex.Message;
                return new HttpStatusCodeResult(400);
            }
            finally
            {
                try
                {
                    if (!string.IsNullOrEmpty(model.APP_ID))
                    {
                        // 能夠取得 APP_ID 情況時,
                        // 將呼叫 MyData-API Endpoint 的回應狀態 寫入到案件資料
                        model.MYDATA_TX_TIME = DateTime.Now;
                        dao.UpdateApply010002MyData(model);
                    }
                }
                catch (Exception ex)
                {
                    logger.Error("ApiSP Endpoint: 寫入案件資料失敗, " + ex.Message, ex);
                }
            }
        }

        /// <summary>
        /// 當呼叫 GetServiceData() 完成 MyData /service/data 的呼叫並取得回應後, 
        /// 會透過這個 interface callback 回傳 MyData 回應的資料
        /// </summary>
        /// <param name="tx_id"></param>
        /// <param name="statusCode"></param>
        /// <param name="statusCodeDesc"></param>
        /// <param name="dataSavePath"></param>
        public void OnServiceDataDone(string tx_id, string statusCode, string statusCodeDesc, string dataSavePath)
        {
            logger.Info("OnServiceDataDone: tx_id=" + tx_id + ", " + statusCodeDesc + ", dataSavePath=" + dataSavePath);

            try
            {
                // 以 MyData 的 TX_ID 取得 APPLY_01002 案件資料
                ApplyDAO dao = new ApplyDAO();
                Apply_010002Model app_SN_Where = new Apply_010002Model();
                app_SN_Where.MYDATA_TX_ID = tx_id;
                Apply_010002Model app_SN_data = dao.GetRow(app_SN_Where);
                if (app_SN_data == null)
                {
                    logger.Error("OnServiceDataDone: 找不到指定 TX_ID 的 Apply_010002 資料, tx_id=" + tx_id);
                    return;
                }

                List<string> myDataResultMsgs = new List<string>();
                string mydataIDCN = "";
                string mydataLOWREC = "";

                if ("200".Equals(statusCode))
                {
                    // 取得「個人戶籍資料.json」 檔案
                    string resourceIdIDCN = DataUtils.GetConfig("MYDATA_RESOURCE_ID_IDCN_010002");  // 取用資料集-個人戶籍資料(resource_id)
                    string fileIDCN_Name1 = "個人戶籍資料.json";
                    DirectoryInfo IDCN_di = new DirectoryInfo(Path.Combine(dataSavePath, resourceIdIDCN));
                    if (IDCN_di != null) { foreach (var fi in IDCN_di.GetFiles("*.json")) { fileIDCN_Name1 = (fi.Name ?? fileIDCN_Name1); } }
                    string fileIDCN = Path.Combine(Path.Combine(dataSavePath, resourceIdIDCN), fileIDCN_Name1);

                    // 取得「低收入戶及中低收入戶證明.json」
                    string resourceIdLOWREC = DataUtils.GetConfig("MYDATA_RESOURCE_ID_LOWREC_010002");  // 取用資料集-低收入戶證明(resource_id)
                    string fileLOWREC_Name1 = "低收入戶及中低收入戶證明.json";
                    DirectoryInfo LOWREC_di = new DirectoryInfo(Path.Combine(dataSavePath, resourceIdLOWREC));
                    if (LOWREC_di != null) { foreach (var fi in LOWREC_di.GetFiles("*.json")) { fileLOWREC_Name1 = (fi.Name ?? fileLOWREC_Name1); } }
                    string fileLOWREC = Path.Combine(Path.Combine(dataSavePath, resourceIdLOWREC), fileLOWREC_Name1);

                    if (!System.IO.File.Exists(fileIDCN))
                    {
                        myDataResultMsgs.Add($"MyData「{fileIDCN_Name1}」檔案不存在");
                        logger.Error("OnServiceDataDone: tx_id=" + tx_id + ", MyData 資料檔案不存在: " + fileIDCN);
                    }
                    else
                    {
                        // 讀取 Json 檔案資料
                        logger.Debug("Read File: " + fileIDCN);
                        mydataIDCN = System.IO.File.ReadAllText(fileIDCN);
                    }

                    if (!System.IO.File.Exists(fileLOWREC))
                    {
                        myDataResultMsgs.Add($"MyData「{fileLOWREC_Name1}」檔案不存在");
                        logger.Error("OnServiceDataDone: tx_id=" + tx_id + ", MyData 資料檔案不存在: " + fileLOWREC);
                    }
                    else
                    {
                        // 讀取 Json 檔案資料
                        logger.Debug("Read File: " + fileLOWREC);
                        mydataLOWREC = System.IO.File.ReadAllText(fileLOWREC);
                    }
                }
                else
                {
                    myDataResultMsgs.Add("取得 MyData 資料失敗: " + statusCodeDesc);
                }

                // 將 MyData 取得的資料檔案內容記錄到資料庫
                Apply_010002Model model = new Apply_010002Model();
                model.APP_ID = app_SN_data.APP_ID;
                model.MYDATA_TX_TIME = DateTime.Now;
                model.MYDATA_IDCN = mydataIDCN;
                model.MYDATA_LOWREC = mydataLOWREC;
                model.MYDATA_TX_RESULT_MSG = string.Join("、", myDataResultMsgs.ToArray());

                dao.UpdateApply010002MyDataResult(model);
            }
            catch (Exception ex)
            {
                logger.Error("OnServiceDataDone: tx_id=" + tx_id + ", " + ex.Message, ex);
            }

        }

        /// <summary>
        /// 用來儲存 MyData 資料檔案的路徑
        /// </summary>
        /// <returns></returns>
        private string GetMyDataSavePath(string appId)
        {
            string folder1 = DataUtils.GetConfig("FOLDER_APPLY_FILE");
            string folder2 = s_SRV_ID + "\\" + DateTime.Now.Year + "\\" + DateTime.Now.Month.ToString("D2") + "\\" + appId;

            string path = Path.Combine(folder1, folder2);
            if (!Directory.Exists(path))
            {
                Directory.CreateDirectory(path);
            }

            return path;
        }


