            string tx_id = "70e28a28-1335-4650-906f-20ae3077d2ce";
            string permission_ticket = "f6fcbee5-85ec-4e47-81aa-484dd8c89da2";
            string secret_key = "vgbFlDGglk714lj3A+tyaKxU86GI/g03cLu8BAmAd2T1QoMClBx2Cj4RWUBT31rN";

            // 對 secret_key 進行解密 
            //   ==> 取得明碼 secret_key
            //   ==> 作為 MyData 取回資料(JWE格式) 解密之用 
            string clientSecret = DataUtils.GetConfig("MYDATA_CLIENT_SECRET_010002");  // AES-256加密金鑰
            string cbcIv = DataUtils.GetConfig("MYDATA_CBC_IV_010002");  // AES加密向量

            string secret_key_plain = "";
            try
            {
                secret_key_plain = (new MyData()).AESDecrypt(clientSecret, cbcIv, Convert.FromBase64String(secret_key));
            }
            catch (Exception ex)
            {
                throw new Exception("secret_key 解密失敗: " + ex.Message, ex);
            }

            MyData myData = new MyData();
            string savePath = GetMyDataSavePath("TEST_APP_ID");
            myData.GetServiceData(myDataSite, tx_id, permission_ticket, secret_key_plain, savePath, this);

            return Content("Send OK");
        }


