        #endregion 新增申辦案件

        #region 補件

        /// <summary>
        /// 補件畫面
        /// </summary>
        /// <param name="model"></param>
        /// <returns></returns>
        public ActionResult AppDoc(string APP_ID)
        {
            SessionModel sm = SessionModel.Get();
            if (sm == null || sm.UserInfo == null) { return RedirectToAction("Index", "History"); }
            ClamMember mem = sm.UserInfo.Member;
            if (mem == null) { return RedirectToAction("Index", "History"); }

            ApplyDAO dao = new ApplyDAO();
            Apply_010002AppDocModel model = new Apply_010002AppDocModel();
            //Apply_010002DetailModel detail = new Apply_010002DetailModel();

            // 案件基本資訊
            ApplyModel app_Where = new ApplyModel();
            app_Where.APP_ID = APP_ID;
            app_Where.SRV_ID = s_SRV_ID;//"011002";
            ApplyModel app_data = dao.GetRow(app_Where);

            // 判斷是否為該案件申請人
            if (!mem.ACC_NO.Equals(app_data.ACC_NO))
            {
                sm.LastErrorMessage = "非案件申請人無法瀏覽次案件 !";// ex.Message;
                return RedirectToAction("Index", "Login");
            }

            // 案件基本資訊
            Apply_010002Model app_SN_Where = new Apply_010002Model();
            app_SN_Where.APP_ID = APP_ID;
            Apply_010002Model app_SN_data = dao.GetRow(app_SN_Where);

            // 取檔案(可依個人方式決定帶值回來的方式，建議用SQL)
            model = dao.GetFile_010002(APP_ID);

            // 取回案件資料(可依個人方式決定帶值回來的方式)
            #region 帶入帳號資訊
            // 補件狀態-案件狀態 1 補件 0 非補件
            model.APPSTATUS = app_data.FLOW_CD.TONotNullString() == "2" ? "1" : "0";
            model.FLOW_CD = app_data.FLOW_CD;
            model.MAILBODY = app_data.MAILBODY;

            // 申請日期
            model.APP_TIME = app_data.APP_TIME;
            // 帳號
            model.ACC_NO = app_data.ACC_NO;
            // 姓名
            model.NAME = app_data.NAME;

            // 承辦單位
            model.ORG_NAME = app_SN_data.ORG_NAME;
            // 申請日期
            model.APPLY_DATE = app_SN_data.APPLY_DATE;
            // 姓名
            model.APNAME = app_SN_data.APNAME;
            //出生年月日
            model.BIRTHDAY = app_SN_data.BIRTHDAY;
            //身分證字號
            model.IDN = app_SN_data.IDN;
            // 電話
            model.TEL = app_SN_data.TEL;
            if (!string.IsNullOrEmpty(app_SN_data.TEL))
            {
                model.TEL_0 = app_SN_data.TEL.ToSplit('-').FirstOrDefault();
                model.TEL_1 = app_SN_data.TEL.ToSplit('-').LastOrDefault().ToSplit('#').FirstOrDefault();
                model.TEL_2 = app_SN_data.TEL.ToSplit('-').LastOrDefault().ToSplit('#').LastOrDefault();
                model.TEL_2 = (app_SN_data.TEL.Contains('#')) ? app_SN_data.TEL.ToSplit('-').LastOrDefault().ToSplit('#').LastOrDefault() : "";
            }
            // 手機
            model.MOBILE = app_SN_data.MOBILE;
            // Mail
            model.EMAIL = app_SN_data.EMAIL;
            if (!string.IsNullOrEmpty(model.EMAIL))
            {
                model.EMAIL_0 = app_SN_data.EMAIL.ToSplit("@").FirstOrDefault();
                model.EMAIL_1 = "0";
                model.EMAIL_2 = app_SN_data.EMAIL.ToSplit("@").LastOrDefault();
            }

            // 配偶姓名
            model.SPNAME = app_SN_data.SPNAME;
            // 配偶出生年月日
            model.SPBIRTHDAY = app_SN_data.SPBIRTHDAY;
            // 配偶身分證字號
            model.SPIDN = app_SN_data.SPIDN;
            // 配偶電話
            model.SPTEL = app_SN_data.SPTEL;
            if (!string.IsNullOrEmpty(app_SN_data.SPTEL))
            {
                model.SPTEL_0 = app_SN_data.SPTEL.ToSplit('-').FirstOrDefault();
                model.SPTEL_1 = app_SN_data.SPTEL.ToSplit('-').LastOrDefault().ToSplit('#').FirstOrDefault();
                model.SPTEL_2 = (app_SN_data.SPTEL.Contains('#')) ? app_SN_data.SPTEL.ToSplit('-').LastOrDefault().ToSplit('#').LastOrDefault() : "";
            }
            // 配偶手機
            model.SPMOBILE = app_SN_data.SPMOBILE;
            // 配偶Mail
            model.SPEMAIL = app_SN_data.SPEMAIL;
            if (!string.IsNullOrEmpty(model.SPEMAIL))
            {
                model.SPEMAIL_0 = app_SN_data.SPEMAIL.ToSplit("@").FirstOrDefault();
                model.SPEMAIL_1 = "0";
                model.SPEMAIL_2 = app_SN_data.SPEMAIL.ToSplit("@").LastOrDefault();
            }

            // 地址
            model.C_ZIPCODE = app_SN_data.C_ZIPCODE;
            model.C_ADDR = app_SN_data.C_ADDR;
            model.H_ZIPCODE = app_SN_data.H_ZIPCODE;
            model.H_ADDR = app_SN_data.H_ADDR;
            model.H_EQUAL = app_SN_data.H_EQUAL;

            model.MYDATA_GET_FG1 = false;
            if (app_SN_data.MYDATA_GET1 != null && app_SN_data.MYDATA_GET1.Equals("Y")) { model.MYDATA_GET_FG1 = true; }
            model.MYDATA_GET_FG2 = false;
            if (app_SN_data.MYDATA_GET2 != null && app_SN_data.MYDATA_GET2.Equals("Y")) { model.MYDATA_GET_FG2 = true; }

            //合併上傳
            model.MERGEYN = app_SN_data.MERGEYN;
            #endregion

            // 取回補件備註欄位
            TblAPPLY_NOTICE ntwhere = new TblAPPLY_NOTICE();
            ntwhere.APP_ID = APP_ID;
            ntwhere.ISADDYN = "N";
            IList<TblAPPLY_NOTICE> ntdata = dao.GetRowList(ntwhere);

            // 無動態欄位
            List<string> ntLst = new List<string>();
            // 動態欄位(通常適用於檔案)
            //List<string> ntLstForList = new List<string>();
            foreach (TblAPPLY_NOTICE item in ntdata)
            {
                ntLst.Add(item.Field);
                //if (item.SRC_NO.TONotNullString().Equals("")) { ntLst.Add(item.Field); }
                //if (!item.SRC_NO.TONotNullString().Equals("")) { ntLstForList.Add(item.Field); }
            }
            // 組成字串丟回前端跑JS
            model.FieldStr = string.Join(",", ntLst);

            return View("AppDoc", model);
        }

        /// <summary>
        /// 補件存檔
        /// </summary>
        /// <param name="model"></param>
        /// <returns></returns>
        public ActionResult SaveAppDoc(Apply_010002AppDocModel model)
        {
            SessionModel sm = SessionModel.Get();
            if (sm == null || sm.UserInfo == null) { return RedirectToAction("Index", "History"); }
            ClamMember mem = sm.UserInfo.Member;
            if (mem == null) { return RedirectToAction("Index", "History"); }

            ApplyDAO dao = new ApplyDAO();
            // 存檔
            var count = dao.UpdateApply010002(model);
            // 寄信
            dao.SendMail_Update(mem.NAME, mem.MAIL, model.APP_ID, s_SRV_NAME, s_SRV_ID, count);

            return Done("2", count);

        }

        /// <summary>
        /// 完成
        /// </summary>
        /// <param name="status"></param>
        /// <param name="Count"></param>
        /// <param name="Msg"></param>
        /// <returns></returns>
        public ActionResult Done(string status, string Count = "", string Msg = "")
        {
            //status: 1.申請作業 2.資料補件
            SessionModel sm = SessionModel.Get();
            if (sm == null || sm.UserInfo == null) { return RedirectToAction("Index", "History"); }
            ClamMember mem = sm.UserInfo.Member;
            if (mem == null) { return RedirectToAction("Index", "History"); }

            Apply_010002DoneModel model = new Apply_010002DoneModel();
            model.status = status.TONotNullString();
            model.Count = Count.TONotNullString();
            model.Msg = Msg.TONotNullString();
            return View("Done", model);
        }
        #endregion


